// Example to Pick and Upload files in React Native
// https://aboutreact.com/file-uploading-in-react-native/

import { StatusBar } from "expo-status-bar";
import React, { useState, useEffect } from "react";
import {
  FlatList,
  StyleSheet,
  Text,
  View,
  Button,
  TouchableOpacity,
} from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import { NavigationContainer } from "@react-navigation/native";

function uploadScreen() {
  // const [singleFile, setSingleFile] = useState(null);

  const selectFile = () => {
    <Text>Hello</Text>;
  };
  return (
    <View style={styles.mainBody}>
      <View style={{ alignItems: "center" }}>
        <Text style={{ fontSize: 30, textAlign: "center" }}>
          Please upload your file here!
        </Text>
        <Text
          style={{
            fontSize: 25,
            marginTop: 20,
            marginBottom: 30,
            textAlign: "center",
          }}
        >
          OUR APP NAME
        </Text>
      </View>
      <TouchableOpacity
        style={styles.buttonStyle}
        activeOpacity={0.5}
        onPress={selectFile}
      >
        <Text style={styles.buttonTextStyle}>Select File</Text>
      </TouchableOpacity>
    </View>
  );
}

const Stack = createStackNavigator();

export default function uploadFeature() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Select" component={uploadScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  mainBody: {
    flex: 1,
    justifyContent: "center",
    padding: 20,
  },
  buttonStyle: {
    backgroundColor: "#307ecc",
    borderWidth: 0,
    color: "#FFFFFF",
    borderColor: "#307ecc",
    height: 40,
    alignItems: "center",
    borderRadius: 30,
    marginLeft: 35,
    marginRight: 35,
    marginTop: 15,
  },
  buttonTextStyle: {
    color: "#FFFFFF",
    paddingVertical: 10,
    fontSize: 16,
  },
  textStyle: {
    backgroundColor: "#fff",
    fontSize: 15,
    marginTop: 16,
    marginLeft: 35,
    marginRight: 35,
    textAlign: "center",
  },
});
